import React from 'react';
import { Link } from 'react-router-dom';

class NavBar extends React.Component {
    state = { hover: false };

    hoverLink = () => {
        this.setState({ hover: !this.state.hover });
    }

    render() {
        return  <div className="header" onMouseEnter={this.hoverLinkAc}>
                    <span class="iconify" data-icon="whh:doghouse" data-inline="false"></span>
                    <div className="header-links">
                        <Link to="/" onMouseEnter={this.hoverLink} onMouseLeave={this.hoverLink}>Location</Link>
                        <Link to="/">Offer</Link>
                        <Link to="/">Contact</Link>
                        <div className="header-links_details">
                            <Link to="/"><ion-icon name="cart"></ion-icon></Link>
                            <Link to="/"><ion-icon name="person"></ion-icon></Link>
                        </div>
                    </div>
                    <div className={this.state.hover ? "header-selected" : "header-hidden"}
                        onMouseEnter={() => this.setState({ hover: false })}
                        onMouseLeave={() => this.setState({ hover: false })}>

                    </div>
                </div>
        };
};

export default NavBar;
